import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import { Typography } from '@mui/material';

export default function () {
  return (
      <Box sx={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      textAlign: 'center',
      }}>
        <Avatar
      alt="Foto de Perfil do João"
      src="https://avatars.githubusercontent.com/u/81587343?v=4"
      sx={{ width: 200, height: 200 }} /><Typography component="h1" variant="h5">
        João Victor Martins
      </Typography><Typography component="h1" variant="subtitle1">
        Hi, I'm a <strong>web developer</strong>, I'm 20 years old and I live in Brazil
      </Typography> 
      </Box>
    
  );
}
